  @Test
  public void testDeserializeCaseSensitive() {
    String caseSensitiveJson =
        "{\"is\":\"tagged-union\",\"options\":{\"Field\":\"boolean\",\"field\":\"boolean\"}}";
    InputType test =
        InputType.taggedUnion(
            new Pair<>("field", InputType.BOOLEAN), new Pair<>("Field", InputType.BOOLEAN));
    deserializeTester(test, caseSensitiveJson);
  }

  @Override
  public void testEquals() {
    InputType taggedUnion1 = InputType.taggedUnion(new Pair<>("field", InputType.INTEGER)),
        taggedUnion2 = InputType.taggedUnion(Map.entry("field", InputType.INTEGER)),
        taggedUnion3 =
            InputType.taggedUnionFromPairs(Stream.of(new Pair<>("field", InputType.INTEGER))),
        taggedUnion4 = InputType.taggedUnion(Stream.of(Map.entry("field", InputType.INTEGER))),
        taggedUnionSameKey = InputType.taggedUnion(new Pair<>("field", InputType.BOOLEAN)),
        taggedUnionSameValue = InputType.taggedUnion(new Pair<>("notField", InputType.INTEGER)),
        taggedUnionDifferent = InputType.taggedUnion(new Pair<>("notField", InputType.BOOLEAN)),
        taggedUnionSuperset =
            InputType.taggedUnion(
                new Pair<>("field", InputType.INTEGER), new Pair<>("field2", InputType.INTEGER)),
        taggedUnionSuperset2 =
            InputType.taggedUnion(
                new Pair<>("field", InputType.INTEGER), new Pair<>("field2", InputType.INTEGER)),
        taggedUnionSupersetDifferent =
            InputType.taggedUnion(
                new Pair<>("field", InputType.INTEGER), new Pair<>("field2", InputType.BOOLEAN)),
        integer = InputType.INTEGER;

    Assert.assertEquals(taggedUnion1, taggedUnion1);
    Assert.assertEquals(taggedUnion2, taggedUnion1);
    Assert.assertEquals(taggedUnion3, taggedUnion1);
    Assert.assertEquals(taggedUnion4, taggedUnion1);
    Assert.assertEquals(taggedUnionSuperset2, taggedUnionSuperset);
    Assert.assertNotEquals(integer, taggedUnion1);
    Assert.assertNotEquals(null, taggedUnion1);
    Assert.assertNotEquals(taggedUnionSameKey, taggedUnion1);
    Assert.assertNotEquals(taggedUnionSameValue, taggedUnion1);
    Assert.assertNotEquals(taggedUnionDifferent, taggedUnion1);
    Assert.assertNotEquals(taggedUnionSuperset, taggedUnion1);
    Assert.assertNotEquals(taggedUnionSupersetDifferent, taggedUnion1);
    Assert.assertNotEquals(taggedUnionSupersetDifferent, taggedUnionSuperset);
  }

